function Home(){
    return(
        <div className='main'>
            <div className='contents'>
                <h1>Movie Search+<sub>developed by Sean</sub></h1>
                <p>
                    Catch The Latest Movies In High Quality. 
                    <br />Plus With No ADS! Enjoy!!<br /> 
                </p>
            </div>
            <img src='./src' alt='Spinning Image' />
        </div>
    )
}


export default Home;
